//域名格式验证

function domain_verification(domain,suffix){

	var rtn = true;

	var maxlenth = 67 - suffix.length,//域名字节数不能超过67位（包含域名后缀.com...）

		regexp = new RegExp("^^[a-z0-9-]{1,"+maxlenth+"}$","i");

	if(!regexp.test(domain)){

		rtn = false;

	}

	//开头不能为 - 

	if(domain.indexOf('-')==0){

		rtn = false;

	}

	//结尾不能为 -

	if(domain.charAt(domain.length-1)=="-"){

		rtn = false;

	}

	return rtn;

}

