/*产品图片轮播展示*/
function adryset() {
	var ax = $('.ad-gallery').data("x"),
		ay = $('.ad-gallery').data("y"),
		by = ay;
	if (Breakpoints.is('xs')) {
		var bx = $(window).width() - 30;
		by = (ay * bx) / ax;
	}
	//图片切换
	$('.ad-gallery').adGallery({
		effect: 'fade',
		height: by,
		loader_image: ''
	});
}
